import "./App.css";
import { getToken } from "./AuthService";
import Home from "./Home";
import LoginPage from "./LoginPage";
import { Router } from "react-router-dom";

function App() {
  return (
    <Router>
      {getToken() ? (
        <Routes>
          <Home />
        </Routes>
      ) : (
        <Routes>
          <LoginPage />
        </Routes>
      )}
    </Router>
  );
}

export default App;
